	/// <summary>
	/// 	Draws a depth-tested line from one point to another.<br/>
	/// 	----------------<br/>
	/// 	x1, y1, z1 : Coordinates for the first point<br/>
	/// 	x2, y2, z2 : Coordinates for the second point<br/>
	/// 	r, g, b, alpha : Color with RGBA-Values<br/>
	/// 	I recommend using a predefined function to call this.<br/>
	/// 	[VB.NET]<br/>
	/// 	Public Sub DrawLine(from As Vector3, [to] As Vector3, col As Color)<br/>
	/// 	    [Function].Call(Hash.DRAW_LINE, from.X, from.Y, from.Z, [to].X, [to].Y, [to].Z, col.R, col.G, col.B, col.A)<br/>
	/// 	End Sub<br/>
	/// 	<br/>
	/// 	[C#]<br/>
	/// 	public void DrawLine(Vector3 from, Vector3 to, Color col)<br/>
	/// 	{<br/>
	/// 	    Function.Call(Hash.DRAW_LINE, from.X, from.Y, from.Z, to.X, to.Y, to.Z, col.R, col.G, col.B, col.A);<br/>
	/// 	}
	/// </summary>
	public static void DRAW_LINE(float x1, float y1, float z1, float x2, float y2, float z2, int red, int green, int blue, int alpha)
	{
		NativeFunction.Natives.DRAW_LINE(x1, y1, z1, x2, y2, z2, red, green, blue, alpha);
	}
	/// <summary>
	/// 	x/y/z - Location of a vertex (in world coords), presumably.<br/>
	/// 	----------------<br/>
	/// 	x1, y1, z1     : Coordinates for the first point<br/>
	/// 	x2, y2, z2     : Coordinates for the second point<br/>
	/// 	x3, y3, z3     : Coordinates for the third point<br/>
	/// 	r, g, b, alpha : Color with RGBA-Values<br/>
	/// 	<br/>
	/// 	Keep in mind that only one side of the drawn triangle is visible: It&amp;apos;s the side, in which the vector-product of the vectors heads to: (b-a)x(c-a) Or (b-a)x(c-b).<br/>
	/// 	But be aware: The function seems to work somehow differently. I have trouble having them drawn in rotated orientation. Try it yourself and if you somehow succeed, please edit this and post your solution.<br/>
	/// 	I recommend using a predefined function to call this.<br/>
	/// 	[VB.NET]<br/>
	/// 	Public Sub DrawPoly(a As Vector3, b As Vector3, c As Vector3, col As Color)<br/>
	/// 	    [Function].Call(Hash.DRAW_POLY, a.X, a.Y, a.Z, b.X, b.Y, b.Z, c.X, c.Y, c.Z, col.R, col.G, col.B, col.A)<br/>
	/// 	End Sub<br/>
	/// 	<br/>
	/// 	[C#]<br/>
	/// 	public void DrawPoly(Vector3 a, Vector3 b, Vector3 c, Color col)<br/>
	/// 	{<br/>
	/// 	    Function.Call(Hash.DRAW_POLY, a.X, a.Y, a.Z, b.X, b.Y, b.Z, c.X, c.Y, c.Z, col.R, col.G, col.B, col.A);<br/>
	/// 	}<br/>
	/// 	BTW: Intersecting triangles are not supported: They overlap in the order they were called.
	/// </summary>
	public static void DRAW_POLY(float x1, float y1, float z1, float x2, float y2, float z2, float x3, float y3, float z3, int red, int green, int blue, int alpha)
	{
		NativeFunction.Natives.DRAW_POLY(x1, y1, z1, x2, y2, z2, x3, y3, z3, red, green, blue, alpha);
	}
