	/// <summary>
	/// 	Creates a checkpoint. Returns the handle of the checkpoint.<br/>
	/// 	<br/>
	/// 	20/03/17 : Attention, checkpoints are already handled by the game itself, so you must not loop it like markers.<br/>
	/// 	<br/>
	/// 	Parameters:<br/>
	/// 	* type - The type of checkpoint to create. See below for a list of checkpoint types.<br/>
	/// 	* pos1 - The position of the checkpoint.<br/>
	/// 	* pos2 - The position of the next checkpoint to point to.<br/>
	/// 	* radius - The radius of the checkpoint.<br/>
	/// 	* color - The color of the checkpoint.<br/>
	/// 	* reserved - Special parameter, see below for details. Usually set to 0 in the scripts.<br/>
	/// 	<br/>
	/// 	Checkpoint types:<br/>
	/// 	0-4---------Cylinder: 1 arrow, 2 arrow, 3 arrows, CycleArrow, Checker<br/>
	/// 	5-9---------Cylinder: 1 arrow, 2 arrow, 3 arrows, CycleArrow, Checker<br/>
	/// 	10-14-------Ring: 1 arrow, 2 arrow, 3 arrows, CycleArrow, Checker<br/>
	/// 	15-19-------1 arrow, 2 arrow, 3 arrows, CycleArrow, Checker      <br/>
	/// 	20-24-------Cylinder: 1 arrow, 2 arrow, 3 arrows, CycleArrow, Checker <br/>
	/// 	25-29-------Cylinder: 1 arrow, 2 arrow, 3 arrows, CycleArrow, Checker    <br/>
	/// 	30-34-------Cylinder: 1 arrow, 2 arrow, 3 arrows, CycleArrow, Checker <br/>
	/// 	35-38-------Ring: Airplane Up, Left, Right, UpsideDown<br/>
	/// 	39----------?<br/>
	/// 	40----------Ring: just a ring<br/>
	/// 	41----------?<br/>
	/// 	42-44-------Cylinder w/ number (uses &amp;apos;reserved&amp;apos; parameter)<br/>
	/// 	45-47-------Cylinder no arrow or number<br/>
	/// 	<br/>
	/// 	If using type 42-44, reserved sets number / number and shape to display<br/>
	/// 	<br/>
	/// 	0-99------------Just numbers (0-99)<br/>
	/// 	100-109-----------------Arrow (0-9)<br/>
	/// 	110-119------------Two arrows (0-9)<br/>
	/// 	120-129----------Three arrows (0-9)<br/>
	/// 	130-139----------------Circle (0-9)<br/>
	/// 	140-149------------CycleArrow (0-9)<br/>
	/// 	150-159----------------Circle (0-9)<br/>
	/// 	160-169----Circle  w/ pointer (0-9)<br/>
	/// 	170-179-------Perforated ring (0-9)<br/>
	/// 	180-189----------------Sphere (0-9)
	/// </summary>
	public static int CREATE_CHECKPOINT(int type, float posX1, float posY1, float posZ1, float posX2, float posY2, float posZ2, float diameter, int red, int green, int blue, int alpha, int reserved)
	{
		return NativeFunction.Natives.CREATE_CHECKPOINT(type, posX1, posY1, posZ1, posX2, posY2, posZ2, diameter, red, green, blue, alpha, reserved);
	}
