	/// <summary>
	/// 	Convert a world coordinate into its relative screen coordinate.  (WorldToScreen)<br/>
	/// 	<br/>
	/// 	Returns a boolean; whether or not the operation was successful. It will return false if the coordinates given are not visible to the rendering camera.<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	For .NET users...<br/>
	/// 	<br/>
	/// 	VB:<br/>
	/// 	Public Shared Function World3DToScreen2d(pos as vector3) As Vector2<br/>
	/// 	<br/>
	/// 	        Dim x2dp, y2dp As New Native.OutputArgument<br/>
	/// 	<br/>
	/// 	        Native.Function.Call(Of Boolean)(Native.Hash.GET_SCREEN_COORD_FROM_WORLD_COORD , pos.x, pos.y, pos.z, x2dp, y2dp)<br/>
	/// 	        Return New Vector2(x2dp.GetResult(Of Single), y2dp.GetResult(Of Single))<br/>
	/// 	      <br/>
	/// 	    End Function<br/>
	/// 	<br/>
	/// 	C#:<br/>
	/// 	Vector2 World3DToScreen2d(Vector3 pos)<br/>
	/// 	    {<br/>
	/// 	        var x2dp = new OutputArgument();<br/>
	/// 	        var y2dp = new OutputArgument();<br/>
	/// 	<br/>
	/// 	        Function.Call&amp;lt;bool&amp;gt;(Hash.GET_SCREEN_COORD_FROM_WORLD_COORD , pos.X, pos.Y, pos.Z, x2dp, y2dp);<br/>
	/// 	        return new Vector2(x2dp.GetResult&amp;lt;float&amp;gt;(), y2dp.GetResult&amp;lt;float&amp;gt;());<br/>
	/// 	    }<br/>
	/// 	//USE VERY SMALL VALUES FOR THE SCALE OF RECTS/TEXT because it is dramatically larger on screen than in 3D, e.g &amp;apos;0.05&amp;apos; small.<br/>
	/// 	<br/>
	/// 	Used to be called _WORLD3D_TO_SCREEN2D<br/>
	/// 	<br/>
	/// 	I thought we lost you from the scene forever. It does seem however that calling SET_DRAW_ORIGIN then your natives, then ending it. Seems to work better for certain things such as keeping boxes around people for a predator missile e.g.
	/// </summary>
	public static bool GET_SCREEN_COORD_FROM_WORLD_COORD(float worldX, float worldY, float worldZ, out float screenX, out float screenY)
	{
		return NativeFunction.Natives.GET_SCREEN_COORD_FROM_WORLD_COORD(worldX, worldY, worldZ, out screenX, out screenY);
	}
