	/// 	Any other value behaves like index = 1, index wraps around after 255<br/>
	/// 	Blips with categories 7, 10 or 11 will all show under the specific categories listing in the map legend, regardless of sprite or name.<br/>
	/// 	Legend entries:<br/>
