	/// <summary>
	/// 	In the C++ SDK, this seems not to work-- the blip isn&amp;apos;t removed immediately. I use it for saving cars.<br/>
	/// 	<br/>
	/// 	E.g.:<br/>
	/// 	<br/>
	/// 	Ped pped = PLAYER::PLAYER_PED_ID();<br/>
	/// 	Vehicle v = PED::GET_VEHICLE_PED_IS_USING(pped);<br/>
	/// 	Blip b = HUD::ADD_BLIP_FOR_ENTITY(v);<br/>
	/// 	<br/>
	/// 	works fine.<br/>
	/// 	But later attempting to delete it with:<br/>
	/// 	<br/>
	/// 	Blip b = HUD::GET_BLIP_FROM_ENTITY(v);<br/>
	/// 	if (HUD::DOES_BLIP_EXIST(b)) HUD::REMOVE_BLIP(&amp;b);<br/>
	/// 	<br/>
	/// 	doesn&amp;apos;t work. And yes, doesn&amp;apos;t work without the DOES_BLIP_EXIST check either. Also, if you attach multiple blips to the same thing (say, a vehicle), and that thing disappears, the blips randomly attach to other things (in my case, a vehicle).<br/>
	/// 	<br/>
	/// 	Thus for me, HUD::REMOVE_BLIP(&amp;b) only works if there&amp;apos;s one blip, (in my case) the vehicle is marked as no longer needed, you drive away from it and it eventually despawns, AND there is only one blip attached to it. I never intentionally attach multiple blips but if the user saves the car, this adds a blip. Then if they delete it, it is supposed to remove the blip, but it doesn&amp;apos;t. Then they can immediately save it again, causing another blip to re-appear.<br/>
	/// 	-------------<br/>
	/// 	<br/>
	/// 	Passing the address of the variable instead of the value works for me.<br/>
	/// 	e.g.<br/>
	/// 	int blip = HUD::ADD_BLIP_FOR_ENTITY(ped);<br/>
	/// 	HUD::REMOVE_BLIP(&amp;blip);<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	Remove blip will currently crash your game, just artificially remove the blip by setting the sprite to a id that is &amp;apos;invisible&amp;apos;.
	/// </summary>
	public static void REMOVE_BLIP(out Blip blip)
	{
		NativeFunction.Natives.REMOVE_BLIP(out blip);
	}
