	/// <summary>
	/// 	0 = american (en-US)<br/>
	/// 	1 = french (fr-FR)<br/>
	/// 	2 = german (de-DE)<br/>
	/// 	3 = italian (it-IT)<br/>
	/// 	4 = spanish (es-ES)<br/>
	/// 	5 = brazilian (pt-BR)<br/>
	/// 	6 = polish (pl-PL)<br/>
	/// 	7 = russian (ru-RU)<br/>
	/// 	8 = korean (ko-KR)<br/>
	/// 	9 = chinesetrad (zh-TW)<br/>
	/// 	10 = japanese (ja-JP)<br/>
	/// 	11 = mexican (es-MX)<br/>
	/// 	12 = chinesesimp (zh-CN)
	/// </summary>
