	/// 	<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	/* OLD INVALID INFO BELOW */<br/>
	/// 	Not tested. Based purely on disassembly. Instantly sets the weather to sourceWeather, then transitions to targetWeather over the specified transitionTime in seconds.<br/>
	/// 	<br/>
	/// 	If an invalid hash is specified for sourceWeather, the current weather type will be used.<br/>
