	/// <summary>
	/// 	Compares two strings up to a specified number of characters.<br/>
	/// 	<br/>
	/// 	Parameters:<br/>
	/// 	str1 - String to be compared.<br/>
	/// 	str2 - String to be compared.<br/>
	/// 	matchCase - Comparison will be case-sensitive.<br/>
	/// 	maxLength - Maximum number of characters to compare. A value of -1 indicates an infinite length.<br/>
	/// 	<br/>
	/// 	Returns:<br/>
	/// 	A value indicating the relationship between the strings:<br/>
	/// 	&amp;lt;0 - The first non-matching character in &amp;apos;str1&amp;apos; is less than the one in &amp;apos;str2&amp;apos;. (e.g. &amp;apos;A&amp;apos; &amp;lt; &amp;apos;B&amp;apos;, so result = -1)<br/>
	/// 	0 - The contents of both strings are equal.<br/>
	/// 	&amp;gt;0 - The first non-matching character in &amp;apos;str1&amp;apos; is less than the one in &amp;apos;str2&amp;apos;. (e.g. &amp;apos;B&amp;apos; &amp;gt; &amp;apos;A&amp;apos;, so result = 1)<br/>
	/// 	<br/>
	/// 	Examples:<br/>
	/// 	MISC::COMPARE_STRINGS(&amp;quot;STRING&amp;quot;, &amp;quot;string&amp;quot;, false, -1); // 0; equal<br/>
	/// 	MISC::COMPARE_STRINGS(&amp;quot;TESTING&amp;quot;, &amp;quot;test&amp;quot;, false, 4); // 0; equal<br/>
	/// 	MISC::COMPARE_STRINGS(&amp;quot;R2D2&amp;quot;, &amp;quot;R2xx&amp;quot;, false, 2); // 0; equal<br/>
	/// 	MISC::COMPARE_STRINGS(&amp;quot;foo&amp;quot;, &amp;quot;bar&amp;quot;, false, -1); // 4; &amp;apos;f&amp;apos; &amp;gt; &amp;apos;b&amp;apos;<br/>
	/// 	MISC::COMPARE_STRINGS(&amp;quot;A&amp;quot;, &amp;quot;A&amp;quot;, true, 1); // 0; equal<br/>
	/// 	<br/>
	/// 	When comparing case-sensitive strings, lower-case characters are greater than upper-case characters:<br/>
	/// 	MISC::COMPARE_STRINGS(&amp;quot;A&amp;quot;, &amp;quot;a&amp;quot;, true, 1); // -1; &amp;apos;A&amp;apos; &amp;lt; &amp;apos;a&amp;apos;<br/>
	/// 	MISC::COMPARE_STRINGS(&amp;quot;a&amp;quot;, &amp;quot;A&amp;quot;, true, 1); // 1; &amp;apos;a&amp;apos; &amp;gt; &amp;apos;A&amp;apos;
	/// </summary>
	public static int COMPARE_STRINGS(string str1, string str2, bool matchCase, int maxLength)
	{
		return NativeFunction.Natives.COMPARE_STRINGS(str1, str2, matchCase, maxLength);
	}
