	/// 	<br/>
	/// 	<br/>
	/// 	**unk1, unk2 and unk3:**<br/>
	/// 	<br/>
	/// 	Not sure what these are for, but they&amp;apos;re always `150, 0, 0` in decompiled scripts.<br/>
