	/// <summary>
	/// 	Full list of animation dictionaries and anims by DurtyFree: https://github.com/DurtyFree/gta-v-data-dumps/blob/master/animDictsCompact.json<br/>
	/// 	<br/>
	/// 	float speed &amp;gt; normal speed is 8.0f<br/>
	/// 	----------------------<br/>
	/// 	<br/>
	/// 	float speedMultiplier &amp;gt; multiply the playback speed<br/>
	/// 	----------------------<br/>
	/// 	<br/>
	/// 	int duration: time in millisecond<br/>
	/// 	----------------------<br/>
	/// 	-1 _ _ _ _ _ _ _&amp;gt; Default (see flag)<br/>
	/// 	0 _ _ _ _ _ _ _ &amp;gt; Not play at all<br/>
	/// 	Small value _ _ &amp;gt; Slow down animation speed<br/>
	/// 	Other _ _ _ _ _ &amp;gt; freeze player control until specific time (ms) has <br/>
	/// 	_ _ _ _ _ _ _ _ _ passed. (No effect if flag is set to be <br/>
	/// 	_ _ _ _ _ _ _ _ _ controllable.)<br/>
	/// 	<br/>
	/// 	int flag:<br/>
	/// 	----------------------<br/>
	/// 	enum eAnimationFlags<br/>
	/// 	{<br/>
	/// 	 ANIM_FLAG_NORMAL = 0,<br/>
	/// 	   ANIM_FLAG_REPEAT = 1,<br/>
	/// 	   ANIM_FLAG_STOP_LAST_FRAME = 2,<br/>
	/// 	   ANIM_FLAG_UPPERBODY = 16,<br/>
	/// 	   ANIM_FLAG_ENABLE_PLAYER_CONTROL = 32,<br/>
	/// 	   ANIM_FLAG_CANCELABLE = 120,<br/>
	/// 	};<br/>
	/// 	Odd number : loop infinitely<br/>
	/// 	Even number : Freeze at last frame<br/>
	/// 	Multiple of 4: Freeze at last frame but controllable<br/>
	/// 	<br/>
	/// 	01 to 15 &amp;gt; Full body<br/>
	/// 	10 to 31 &amp;gt; Upper body<br/>
	/// 	32 to 47 &amp;gt; Full body &amp;gt; Controllable<br/>
	/// 	48 to 63 &amp;gt; Upper body &amp;gt; Controllable<br/>
	/// 	...<br/>
	/// 	001 to 255 &amp;gt; Normal<br/>
	/// 	256 to 511 &amp;gt; Garbled<br/>
	/// 	...<br/>
	/// 	<br/>
	/// 	playbackRate:<br/>
	/// 	<br/>
	/// 	values are between 0.0 and 1.0<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	lockX:  <br/>
	/// 	<br/>
	/// 	0 in most cases 1 for rcmepsilonism8 and rcmpaparazzo_3<br/>
	/// 	&amp;gt; 1 for mini@sprunk<br/>
	/// 	 <br/>
	/// 	<br/>
	/// 	lockY:<br/>
	/// 	<br/>
	/// 	0 in most cases <br/>
	/// 	1 for missfam5_yoga, missfra1mcs_2_crew_react<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	lockZ: <br/>
	/// 	<br/>
	/// 	    0 for single player <br/>
	/// 	    Can be 1 but only for MP 
	/// </summary>
	public static void TASK_PLAY_ANIM(Ped ped, string animDictionary, string animationName, float blendInSpeed, float blendOutSpeed, int duration, int flag, float playbackRate, bool lockX, bool lockY, bool lockZ)
