	/// <summary>
	/// 	Must have targetVehicle, targetPed, OR destination X/Y/Z set<br/>
	/// 	Will follow targeted vehicle/ped, or fly to destination<br/>
	/// 	Set whichever is not being used to 0<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	Mission mode type:<br/>
	/// 	 - 4, 7: Forces heli to snap to the heading if set, flies to destination or tracks specified entity (mode 4 only works for coordinates, 7 works for coordinates OR ped/vehicle)<br/>
	/// 	 - 6: Attacks the target ped/vehicle with mounted weapons. If radius is set, will maintain that distance from target.<br/>
	/// 	 - 8: Makes the heli flee from the ped/vehicle/coordinate<br/>
	/// 	 - 9: Circles around target ped/vehicle, snaps to angle if set. Behavior flag (last parameter) of 2048 switches from counter-clockwise to clockwise circling. Does not work with coordinate destination.<br/>
	/// 	 - 10, 11: Follows ped/vehicle target and imitates target heading. Only works with ped/vehicle target, not coord target<br/>
	/// 	 - 19: Heli lands at specified coordinate, ignores heading (lands facing whatever direction it is facing when the task is started)<br/>
	/// 	 - 20: Makes the heli land when near target ped. It won&amp;apos;t resume chasing.<br/>
	/// 	 - 21: Emulates a helicopter crash<br/>
	/// 	 - 23: makes the heli circle erratically around ped<br/>
	/// 	<br/>
	/// 	<br/>
	/// 	Heli will fly at maxSpeed (up to actual maximum speed defined by the model&amp;apos;s handling config)<br/>
	/// 	You can use SET_DRIVE_TASK_CRUISE_SPEED to modulate the speed based on distance to the target without having to re-invoke the task native. Setting to 8.0 when close to the destination results in a much smoother approach.<br/>
	/// 	<br/>
	/// 	If minHeight and maxHeight are set, heli will fly between those specified elevations, relative to ground level and any obstructions/buildings below. You can specify -1 for either if you only want to specify one. Usually it is easiest to leave maxHeight at -1, and specify a reasonable minHeight to ensure clearance over any obstacles. Note this MUST be passed as an INT, not a FLOAT. <br/>
	/// 	<br/>
	/// 	Radius affects how closely the heli will follow tracked ped/vehicle, and when circling (mission type 9) sets the radius (in meters) that it will circle the target from<br/>
	/// 	<br/>
	/// 	Heading is -1.0 for default behavior, which will point the nose of the helicopter towards the destination. Set a heading and the heli will lock to that direction when near its destination/target, but may still turn towards the destination when flying at higher speed from a further distance.<br/>
	/// 	<br/>
	/// 	Behavior Flags is a bitwise value that modifies the AI behavior. Not clear what all flags do, but here are some guesses/notes:<br/>
	/// 	   1: Forces heading to face E<br/>
	/// 	   2: Unknown<br/>
	/// 	   4: Tight circles around coordinate destination<br/>
	/// 	   8: Unknown<br/>
	/// 	  16: Circles around coordinate destination facing towards destination<br/>
	/// 	  32: Flys to normally, then lands at coordinate destination and stays on the ground (using mission type 4)<br/>
	/// 	  64: Ignores obstacles when flying, will follow at specified minHeight above ground level but will not avoid buildings, vehicles, etc.<br/>
	/// 	 128: Unknown<br/>
	/// 	 256: Unknown<br/>
	/// 	 512: Unknown<br/>
	/// 	1024: Unknown <br/>
	/// 	2048: Reverses direction of circling (mission type 9) to clockwise<br/>
	/// 	4096: Hugs closer to the ground, maintains minHeight from ground generally, but barely clears buildings and dips down more between buildings instead of taking a more efficient/safe route<br/>
	/// 	8192: Unknown<br/>
	/// 	<br/>
	/// 	Unk3 is a float value, you may see -1082130432 for this value in decompiled native scripts, this is the equivalent to -1.0f. Seems to affect acceleration/aggressiveness, but not sure exactly how it works. Higher value seems to result in lower acceleration/less aggressive flying. Almost always -1.0 in native scripts, occasionally 20.0 or 50.0. Setting to 400.0 seems to work well for making the pilot not overshoot the destination when using coordinate destination.<br/>
	/// 	<br/>
	/// 	Notes updated by PNWParksFan, May 2021<br/>
	/// 	
	/// </summary>
