	/// 	EXAMPLE USAGE:<br/>
	/// 	<br/>
	/// 	Fly around target (Precautiously, keeps high altitude):<br/>
	/// 	Function.Call(Hash.TASK_PLANE_MISSION, pilot, selectedAirplane, 0, 0, Target.X, Target.Y, Target.Z, 4, 100f, 0f, 90f, 0, 200f);<br/>
	/// 	<br/>
	/// 	Fly around target (Dangerously, keeps VERY low altitude):<br/>
	/// 	Function.Call(Hash.TASK_PLANE_MISSION, pilot, selectedAirplane, 0, 0, Target.X, Target.Y, Target.Z, 4, 100f, 0f, 90f, 0, -500f);<br/>
	/// 	<br/>
	/// 	Fly directly into target:<br/>
	/// 	Function.Call(Hash.TASK_PLANE_MISSION, pilot, selectedAirplane, 0, 0, Target.X, Target.Y, Target.Z, 4, 100f, 0f, 90f, 0, -5000f);<br/>
	/// 	<br/>
	/// 	EXPANDED INFORMATION FOR ADVANCED USAGE (custom pilot)<br/>
	/// 	<br/>
	/// 	&amp;apos;physicsSpeed&amp;apos;: (THIS IS NOT YOUR ORDINARY SPEED PARAMETER: READ!!)<br/>
	/// 	Think of this -first- as a radius value, not a true speed value.  The ACTUAL effective speed of the plane will be that of the maximum speed permissible to successfully fly in a -circle- with a radius of &amp;apos;physicsSpeed&amp;apos;.  This also means that the plane must complete a circle before it can begin its &amp;quot;bombing run&amp;quot;, its straight line pass towards the target.  p9 appears to influence the angle at which a &amp;quot;bombing run&amp;quot; begins, although I can&amp;apos;t confirm yet.<br/>
	/// 	<br/>
	/// 	VERY IMPORTANT: A &amp;quot;bombing run&amp;quot; will only occur if a plane can successfully determine a possible navigable route (the slower the value of &amp;apos;physicsSpeed&amp;apos;, the more precise the pilot can be due to less influence of physics on flightpath).  Otherwise, the pilot will continue to patrol around Destination (be it a dynamic Entity position vector or a fixed world coordinate vector.)<br/>
	/// 	<br/>
	/// 	0 = Plane&amp;apos;s physics are almost entirely frozen, plane appears to &amp;quot;orbit&amp;quot; around precise destination point<br/>
	/// 	1-299 = Blend of &amp;quot;frozen, small radius&amp;quot; vs. normal vs. &amp;quot;accelerated, hyperfast, large radius&amp;quot;<br/>
	/// 	300+ =  Vehicle behaves entirely like a normal gameplay plane.<br/>
	/// 	<br/>
	/// 	&amp;apos;patrolBlend&amp;apos; (The lower the value, the more the Destination is treated as a &amp;quot;fly AT&amp;quot; rather than a &amp;quot;fly AROUND point&amp;quot;.)<br/>
	/// 	<br/>
	/// 	Scenario: Destination is an Entity on ground level, wide open field<br/>
	/// 	-5000 = Pilot kamikazes directly into Entity<br/>
	/// 	-1000 = Pilot flies extremely low -around- Entity, very prone to crashing<br/>
	/// 	-200 = Pilot flies lower than average around Entity.<br/>
	/// 	0 = Pilot flies around Entity, normal altitude<br/>
	/// 	200 = Pilot flies an extra eighty units or so higher than 0 while flying around Destination (this doesn&amp;apos;t seem to correlate directly into distance units.)<br/>
	/// 	<br/>
	/// 	-- Valid mission types found in the exe: --<br/>
	/// 	<br/>
	/// 	0 = None<br/>
	/// 	1 = Unk<br/>
	/// 	2 = CTaskVehicleRam<br/>
	/// 	3 = CTaskVehicleBlock<br/>
	/// 	4 = CTaskVehicleGoToPlane<br/>
	/// 	5 = CTaskVehicleStop<br/>
	/// 	6 = CTaskVehicleAttack<br/>
	/// 	7 = CTaskVehicleFollow<br/>
	/// 	8 = CTaskVehicleFleeAirborne<br/>
	/// 	9= CTaskVehicleCircle<br/>
	/// 	10 = CTaskVehicleEscort<br/>
	/// 	15 = CTaskVehicleFollowRecording<br/>
	/// 	16 = CTaskVehiclePoliceBehaviour<br/>
	/// 	17 = CTaskVehicleCrash
	/// </summary>
	public static void TASK_PLANE_MISSION(Ped pilot, Vehicle aircraft, Vehicle targetVehicle, Ped targetPed, float destinationX, float destinationY, float destinationZ, int missionFlag, float angularDrag, float targetReached, float targetHeading, float maxZ, float minZ, bool precise)
	{
		NativeFunction.Natives.TASK_PLANE_MISSION(pilot, aircraft, targetVehicle, targetPed, destinationX, destinationY, destinationZ, missionFlag, angularDrag, targetReached, targetHeading, maxZ, minZ, precise);
	}
