	/// 	VEHICLE::GET_CLOSEST_VEHICLE(x, y, z, radius, hash, unknown leave at 70) <br/>
	/// 	<br/>
	/// 	x, y, z: Position to get closest vehicle to.<br/>
	/// 	radius: Max radius to get a vehicle.<br/>
	/// 	modelHash: Limit to vehicles with this model. 0 for any.<br/>
	/// 	flags: The bitwise flags altering the function&amp;apos;s behaviour.<br/>
	/// 	<br/>
	/// 	Does not return police cars or helicopters.<br/>
	/// 	<br/>
	/// 	It seems to return police cars for me, does not seem to return helicopters, planes or boats for some reason<br/>
	/// 	<br/>
	/// 	Only returns non police cars and motorbikes with the flag set to 70 and modelHash to 0. ModelHash seems to always be 0 when not a modelHash in the scripts, as stated above. <br/>
	/// 	<br/>
	/// 	These flags were found in the b617d scripts: 0,2,4,6,7,23,127,260,2146,2175,12294,16384,16386,20503,32768,67590,67711,98309,100359.<br/>
